INSERT INTO `staff` VALUES (1,'Bhuwan ',NULL,'K.C.',NULL,'Bhuwan K.C. (Nepali: भुवन केसी;born: 17 September 1956) is a Nepali actor, director, producer, singer, and politician known for his work in Nepali cinema. He has started career through Radio Nepal as a childhood artist. He was among the most commercially successful Nepali actors of the 1980s, 1990s and 2000s. He is also a current chairman of Film Development Board, he was appointed for this position on 26 July 2022. \r\n',NULL,'1956-09-17',1,NULL,NULL,'Vijaya Malla KC (separated) \r\nSushmita Bomjan (separated)\r\nJiya K.C. (2017-present)',NULL,'https://upload.wikimedia.org/wikipedia/commons/b/bf/Bhuwan_KC.png',NULL,NULL,NULL),(2,'Tripti ',NULL,'Nadakar',NULL,NULL,NULL,'1959-01-02',0,NULL,NULL,NULL,NULL,'http://3.bp.blogspot.com/-btODjaaeQ1c/TflFzfVQwPI/AAAAAAAAFPE/nuWTM4w-yzo/s1600/Tripti.jpg',NULL,NULL,NULL),(3,'Udit','Narayan','Jha',NULL,'Udit Narayan (born 1 December 1955)is an Indian playback singer whose songs have been featured mainly in Hindi films. He has also sung in various other languages including Telugu, Kannada, Tamil, Bengali, Odia, Bhojpuri, Nepali, Malayalam, Assamese , Bagheli and Maithili. He has won 4 National Film Awards[6] and 5 Filmfare Awards with 20 nominations among many others. He got to sing with Mohammed Rafi in his Hindi playback debut in movie Unees-Bees in 1980 and also with Kishore Kumar in the 1980s. He finally made his mark in the 1988 movie Qayamat Se Qayamat Tak starring Aamir Khan and Juhi Chawla, his song \"Papa Kehte Hain\" was his notable performance which earned him his first Filmfare Award in the 1980s and he established himself in Bollywood Playback Singing. He is the only male singer in the history of the Filmfare Awards to have won in over three decades (the 1980s, 1990s, and 2000s).\r\n\r\nAfter the success of Qayamat Se Qayamat Tak with more than 8 million sales, the soundtrack became one of the highest selling albums in the 1980s. The soundtrack was a breakthrough for the careers of Anand–Milind, as well as T-Series, one of India\'s leading record labels.[8] after which he was one of the favourites of music directors. In the 1990s he sung for a thousands of songs including Hindi and Nepali languages. Recognising his contribution, King of Nepal Birendra Bir Bikram Shah Dev awarded him with the Order of Gorkha Dakshina Bahu in 2001 after which for his contribution to Indian cinema and music, he was awarded the Padma Shri in 2009, and in 2016 he was awarded the Padma Bhushan by the Government of India. and Chitragupta Cineyatra Samman 2015 for his contribution to Bhojpuri cinema. As many as 21 of his tracks feature in BBC\'s \"Top 40 Bollywood Soundtracks of all time\". ',NULL,'1955-12-01',1,NULL,NULL,NULL,NULL,'https://m.media-amazon.com/images/M/MV5BNzcxZGNmNzQtMDljZi00ZDdkLTg5MTAtNDYwNzY3ZWM1ZjQ2XkEyXkFqcGdeQXVyMTExNDQ2MTI@._V1_Ratio1.0000_AL_.jpg',NULL,NULL,NULL),(4,'Neer ','Bikram ','Shah',NULL,'Neer Bikram Shah, also known as Nir Shah, is a senior Nepalese film actor, director, producer, poet, songwriter, and businessman. He is considered one of the leading actors in Nepali cinema history and an actor with multiple identities.He is related to the royal family of Nepal.',NULL,'1953-10-12',NULL,NULL,NULL,NULL,NULL,'https://artistnepal.com/wp-content/uploads/2020/04/Neer_shah_Artistnepal_actor_director3.jpg',NULL,NULL,NULL),(5,'Tulsi Ghimire',NULL,NULL,NULL,'Tulsi Ghimire is an Indian film director, screenwriter, film editor, cameraman, actor and lyricist known for his works in Nepali films. Regarded as one of the greatest filmmakers of Nepali cinema, he is known for his romantic and masala film that dealt with social issues of Nepali society, portrayal of deep human emotions and masala films. He has directed some of the iconic Nepali films like Kusume Rumal, Deuta, Laure, Chino, Dakshina, Balidan and Darpan Chaya. Majority of his movies in 1990s were blockbusters and two of the movies Kusume Rumal and Darpan Chaya went on to become the highest grossing Nepali film of all time.\r\n','','1951-07-15',1,NULL,NULL,NULL,NULL,'https://www.nextmodelsnepal.com/assets/uploads/2019/01/214x31712292tulsi-ghimire.png',NULL,NULL,NULL),(7,'Deepak ','Raj ','Giri',NULL,'Deepak Raj Giri (Nepali: दिपकराज गिरि) is a Nepali actor, director and producer.\r\n\r\nDeepak Raj Giri produced and acted in the television show Tito Satya, which ran for 12 years from 2003 to 2015. He has also worked in films such as Woda Number 6 in 2015 and Shatru Gate in 2018.\r\n\r\nIn 2016, he produced Chhakka Panja, where he also played one of the lead roles. The film was followed up by the sequels Chhakka Panja 2 in 2017 and Chhakka Panja 3 in 2018. Giri received two NEFTA awards, for \"best story and screenplay\", for his work on Chhakka Panja 3.\r\nThe Chhakka Panja franchise is the most commercially successful films in Nepali cinema.[citation needed] He is also the host of the television show Crime Patrol Nepal In year 2022, Giri won National Film Award for the \"best actor\" for his film Chha Maya Chhapakkai which was released on 2019. Giri is currently working on his upcoming movie Chhakka Panja 4 which will be released on 3 March 2023. He confirmed that the shooting is over and are working on post-production through Social Media. ',NULL,'1969-04-13',1,NULL,NULL,NULL,NULL,'https://upload.wikimedia.org/wikipedia/commons/thumb/3/3e/Deepak_Raj_Giri.jpg/220px-Deepak_Raj_Giri.jpg',NULL,NULL,NULL),(8,'Kedar ','Ghimire','',NULL,NULL,NULL,'1976-04-10',1,NULL,NULL,NULL,NULL,'https://www.lensnepal.com/files/profiles/kedar-ghimire.jpg',NULL,NULL,NULL),(9,'Buddhi ',NULL,'Tamang',NULL,NULL,NULL,'1982-04-02',1,NULL,NULL,NULL,NULL,'https://upload.wikimedia.org/wikipedia/commons/thumb/e/ee/Buddhi_Tamang.jpg/220px-Buddhi_Tamang.jpg',NULL,NULL,NULL),(10,'Jeetu Nepal',NULL,NULL,NULL,NULL,NULL,'1975-06-15',1,NULL,NULL,NULL,NULL,'https://upload.wikimedia.org/wikipedia/commons/thumb/a/a7/Jeetu_Nepal.JPG/220px-Jeetu_Nepal.JPG',NULL,NULL,NULL