imed movies and one is soon to release. He has directed five plays among which most of them have been staged in different national and international theatre festivals. As a writer, he published three books.[needs update]\r\n\r\nHe has also worked with BBC Media Action as an actor, writer, producer and editor for an international award-winning drama \'Katha Mitho Sarangiko\', and as an editor for its reconstruction radio drama \'Kathamaala\'. He also worked with British Council as Drama Production Consultant. Currently, he is the chairperson of Tukee Arts Pvt. Ltd. ',NULL,NULL,1,NULL,NULL,NULL,NULL,'https://www.themoviedb.org/t/p/w500/n7F46qQ3MB8WoUFajUSrRyIhNlU.jpg',NULL,NULL,NULL),(23,'Rabindra ','Singh ','Baniya',NULL,'Rabindra Singh Baniya is a Nepali Actor, Producer and Theatre Actor/Director. Prior to entering into Nepali cinema industry, he was highly involved in stage dramas. He is popularly known as \"Hanuman Ji\" \"हनुमान जी\" (Hindu God) for his role in a hit Nepali movie, Pashupati Prasad (2016), which brought him into the limelight of the Nepali movie industry. He is actively involve in Nepali Film industry as an Actor and producer. His works are Talakjung Vs Tulke(Executive Producer/Actor) (2014), Jatra (2016 film)(Executive Producer/Actor)(2016) and White Sun(Actor) (2016). Jhumkee(2016), Jatrai Jatra(Executive Producer/Actor) (2019), Looking for a Lady With Fangs and a Moustache(Producer/Actor)(2019) ',NULL,NULL,1,NULL,NULL,NULL,NULL,'https://upload.wikimedia.org/wikipedia/commons/thumb/4/4e/Rabindra_Singh_Baniya.jpg/220px-Rabindra_Singh_Baniya.jpg',NULL,NULL,NULL),(24,'Bipin ',NULL,'Karki',NULL,'Bipin Karki (Nepali: बिपिन कार्की, born 21 August 1982 in Bahuni, Nepal) is a Nepalese film and theatre actor known for his work in Nepali cinema.\r\n\r\nKarki began his career at a young age by appearing in stage plays with his brother Arjun Karki. Karki performed stage plays with Kamal Mani Nepal and his guru Sunil Pokharel at Gurukul Theatre in Kathmandu i